import logo from './logo.svg';
import './App.css';
import DistanceToTime from './Components/DistanceToTime';

function App() {
  return (
    <div className="App">
      <form>
        <input type="number" />
        </form>
      <DistanceToTime />
    </div>
  );
}

export default App;
